@thebrazilianguys makes these crispy stuffed pockets of goodness! You can chose between a hashbrown (most traditional), Brazilian cheese bread (gluten free since its made with cassava starch), sweet potato, or cassava/yuca shell stuffed with a variety of fillings and then cooked over an open flame in little cast iron skillets! I chose the Brazilian cheese bread crust with chicken, garlic sauce, and mozzarella cheese filling...served with their homemade hot sauce! Now i wanna try all the combinations! #braziliancheesebread #cassava #brazilianfood #garlicsauce #sandiegofood #thebrazilianguys #brazilian #stuffedhashbrowns #littleitalysandiego #wednesdaymarket @littleitalysd @littleitalymercato
